function search() {
  const searchInput = document.getElementById("searchInput").value.toLowerCase();
  const gallery = document.getElementById("gallery");
  gallery.innerHTML = ""; // Limpia el contenido del contenedor gallery

  const resultados = personajes.filter(personaje => personaje.nombre.toLowerCase().includes(searchInput));
  resultados.forEach(personaje => {
    const linkElement = document.createElement("a");
    linkElement.href = personaje.imagen;
    linkElement.download = personaje.nombre + ".jpg";

    const imgElement = document.createElement("img");
    imgElement.src = personaje.imagen;
    imgElement.alt = personaje.nombre;
    imgElement.style.width = "6cm"; // Establece el ancho de la imagen en 6 centímetros
    imgElement.style.height = "10cm"; // Establece la altura de la imagen en 10 centímetros
linkElement.appendChild(imgElement); gallery. appendChild(enlaceElemento)
  });
}


function mostrarCategorias() {
  var categorias = document.getElementById("categorias");
  if (categorias.style.display === "block") {
      categorias.style.display = "none";
  } else {
      categorias.style.display = "block";
  }
}

