function mostrarCategorias() {
  var categorias = document.getElementById("categorias");
  if (categorias.style.display === "block") {
      categorias.style.display = "none";
  } else {
      categorias.style.display = "block";
  }
}

function mostrarImagenes(categoria) {
  var galeria = document.getElementById("galeria");
  galeria.innerHTML = ""; // Limpia cualquier contenido previo
  
  var imagenesFiltradas = imagenes.filter(function(imagen) {
      return imagen.categoria === categoria;
  });
  
  if (imagenesFiltradas.length > 0) {
      for (var i = 0; i < imagenesFiltradas.length; i++) {
          var imagen = document.createElement("img");
          imagen.src = imagenesFiltradas[i].nombre;
          imagen.style.width = "6cm"; // Ancho de la imagen
          imagen.style.height = "10cm"; // Alto de la imagen
          galeria.appendChild(imagen);
      }
  }
}

